import { gql } from "@apollo/client";

export const CREATE_USER_MUTATION = gql`
  mutation createTodo(
    $title: String!
  )   {
      id
    }
  }
`;  

export const UPDATE_USER_MUTATION = gql`
  mutation createTodo(
    $title: String!
  )   {
      id
    }
  }
`;  

export const DELETE_USER_MUTATION = gql`
  mutation createTodo(
    $title: String!
  )   {
      id
    }
  }
`;
